import React, { Component } from 'react';
import './App.css';
import Login from './components/Login';
import Register from './components/Register';

class App extends Component {

  state = {
    token: null
  }
  setToken = (token) => {
    this.setState({ token })
  }

  render() {
    return (
      <div className="App">
        <div className="container">
          <div className="row">

            <div className="col-6">
              <Login tokenCb={this.setToken} />
            </div>
            <div className="col-6">
              <Register tokenCb={this.setToken} />
            </div>

          </div>

        </div>
      </div>

    );
  }
}

export default App;
